import React, { Component, useEffect, useState } from 'react';
import { StyleSheet, Text, View, Image, ImageBackground, InlineImage, TouchableOpacity} from 'react-native';
import ContratarTrabajadores from "../components/ContratarTrabajadores";

import { useNavigation } from '@react-navigation/native';

const Inicio =({navigation})=>{

  return (

    <View>

        <ContratarTrabajadores style={{ fontSize: 48}}
          text="CONTRATAR"
          onPress={ () =>{
          navigation.navigate('IniciarSesion')
        }}
        />

    </View>

  );
}

export default Inicio

const styles = StyleSheet.create({

});
